const calculator = (arr) => {
	var result = 0;
	var index;

	for (index = 0; index < arr.length; ++index) {
		result += arr[index] * Math.pow(10, index);
	}
	result = result + 99 * Math.pow(10, arr.length);

	return result;
};

export default calculator;
